import React, { useState, useEffect, useRef } from 'react';
import ReactMarkdown from 'react-markdown';

const ChatbotUI = () => {
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const effectRan = useRef(false);

  const sendMessage = async (message) => {
    // ... (sendMessage function remains the same)
  };

  useEffect(() => {
    if (effectRan.current === false) {
      sendMessage('Hello, AI Assistant!');
      return () => effectRan.current = true;
    }
  }, []);

  return (
    <div className="flex flex-col h-screen">
      {/* Top section for logo */}
      <div className="h-20 bg-gray-100 flex items-center justify-center">
        <span className="text-xl font-bold">Your Logo Here</span>
      </div>

      {/* Main content area */}
      <div className="flex flex-1">
        {/* Left sidebar */}
        <div className="w-1/4 bg-gray-200 p-4">
          <h2 className="text-lg font-semibold mb-2">Left Sidebar</h2>
          <p>You can add text or other content here.</p>
        </div>

        {/* Chatbot UI */}
        <div className="flex-1 flex flex-col max-w-2xl mx-auto p-4 border-l border-r">
          <h1 className="text-2xl font-bold mb-4">AI Assistant</h1>
          <div className="flex-1 overflow-y-auto mb-4">
            {messages.map((message, index) => (
              <div key={index} className={`mb-2 ${message.sender === 'user' ? 'text-right' : 'text-left'}`}>
                <span className={`inline-block p-2 rounded-lg ${message.sender === 'user' ? 'bg-blue-500 text-white' : 'bg-gray-200'}`}>
                  {message.sender === 'user' ? (
                    message.text
                  ) : (
                    <>
                      <ReactMarkdown>{message.text}</ReactMarkdown>
                      {message.citations && message.citations.length > 0 && (
                        <div className="mt-2 text-sm text-gray-600">
                          <strong>Citations:</strong>
                          <ol>
                            {message.citations.map((citation, idx) => {
                              const displayUrl = citation.mappedUrl || citation.originalUrl;
                              return (
                                <li key={idx}>
                                  [{citation.index}]{' '}
                                  <a
                                    href={displayUrl}
                                    target="_blank"
                                    rel="noopener noreferrer"
                                    className="text-blue-500 hover:underline"
                                  >
                                    {displayUrl}
                                  </a>
                                  {citation.error && ` (${citation.error})`}
                                </li>
                              );
                            })}
                          </ol>
                        </div>
                      )}
                    </>
                  )}
                </span>
              </div>
            ))}
          </div>
          <div className="flex">
            <input
              type="text"
              value={input}
              onChange={(e) => setInput(e.target.value)}
              onKeyPress={(e) => e.key === 'Enter' && !isLoading && input.trim() && sendMessage(input)}
              placeholder="Type a message..."
              className="flex-1 p-2 border rounded-l-lg"
              disabled={isLoading}
            />
            <button
              onClick={() => !isLoading && input.trim() && sendMessage(input)}
              className="p-2 bg-blue-500 text-white rounded-r-lg"
              disabled={isLoading}
            >
              Send
            </button>
          </div>
        </div>

        {/* Right sidebar */}
        <div className="w-1/4 bg-gray-200 p-4">
          <h2 className="text-lg font-semibold mb-2">Right Sidebar</h2>
          <p>You can add more text or content here.</p>
        </div>
      </div>

      {/* Footer */}
      <div className="h-16 bg-gray-100 flex items-center justify-center">
        <span>Footer content goes here</span>
      </div>
    </div>
  );
};

export default ChatbotUI;
